import '../assets/navbar.css'
import React, { useEffect, useRef } from 'react';

function Navbar(): JSX.Element {
    const handleResize = () => {
        const curve = curveRef.current;
        if (!curve) return;

    }

    return (
        <nav>
            <ul>
                <li>Home</li>
                <li>About</li>
                <li>Projects</li>
                <li>Contact</li>
            </ul>
            <div className='curve' ref={curveRef}/>
        </nav>
    )
}

export default Navbar
